const i="winners",a={en:"Results of the 1st competition final round",lt:"I-ojo konkurso finalinio turo rezultatai"},t={en:"October 8<sup>th</sup>, 2018 - 8:00 pm",lt:"2018 m. spalio 8 d. 20:00"},e={en:"Results of the 1<sup>st</sup> Competition Final Round",lt:"I-ojo konkurso finalinio turo rezultatai"},o={full:{en:'<p>We are excited to announce the winners of the 1<sup>st</sup> international music composition competition "Future Symphony"!</p><p><b>1<sup>st</sup> place:</b> \u{1F1E8}\u{1F1F3}\uFE0F Xiaoran Jiang ("Befall")<br><b>2<sup>nd</sup> place:</b> \u{1F1F0}\u{1F1F7}\uFE0F SiHyun Uhm ("Apex of Longing"), \u{1F1FA}\u{1F1F8}\uFE0F Robert Ge ("Night Run")<br><b>3<sup>rd</sup> place:</b> \u{1F1E8}\u{1F1F3}\uFE0F Pengyi Li ("Polymorphism")<br><b>Audience Sympathy prize:</b> \u{1F1F1}\u{1F1F9}\uFE0F Matas Drukteinis ("Late Night at the City")</p><p>Biggest congratulations to the composers!</p><p>Compositions were evaluated by the jury:</p><p>Marius Baranauskas (chairman)<br>Gediminas Gelgotas<br>Ayal Adler<br>Rasa Murauskait\u0117<br>Modestas Barkauskas</p><p>The competition featured composers from Lithuania, Estonia, Georgia, France, USA, Canada, China, Taiwan, Australia and South Korea.</p>',lt:'<p>D\u017Eiaugsmingai prane\u0161ame I-ojo tarptautinio kompozicij\u0173 simfoniniam orkestrui konkurso rezultatus!</p><p><b>I vieta:</b> \u{1F1E8}\u{1F1F3}\uFE0F Xiaoran Jiang ("Befall")<br><b>II vieta:</b> \u{1F1F0}\u{1F1F7}\uFE0F SiHyun Uhm ("Apex of Longing"), \u{1F1FA}\u{1F1F8}\uFE0F Robert Ge ("Night Run")<br><b>III vieta:</b> \u{1F1E8}\u{1F1F3}\uFE0F Pengyi Li ("Polymorphism")<br><b>Publikos simpatijos prizas:</b> \u{1F1F1}\u{1F1F9}\uFE0F Matas Drukteinis ("Late Night at the City")</p><p>Did\u017Eiausi sveikinimai kompozitoriams!</p><p>K\u016Brinius vertino \u017Eiuri nariai:</p><p>Marius Baranauskas (pirmininkas)<br>Gediminas Gelgotas<br>Ayal Adler<br>Rasa Murauskait\u0117<br>Modestas Barkauskas</p><p>Konkurse dalyvavo kompozitoriai i\u0161 Lietuvos, Estijos, Gruzijos, Pranc\u016Bzijos, JAV, Kanados, Kinijos, Taivano, Australijos ir Piet\u0173 Kor\u0117jos.</p>'}},s={regular:"xiaoran_jiang.jpg",small:"xiaoran_jiang_small.jpg"};var Gi={slug:i,meta:a,date:t,title:e,content:o,images:s},oa=Object.freeze({__proto__:null,[Symbol.toStringTag]:"Module",slug:i,meta:a,date:t,title:e,content:o,images:s,default:Gi});const n="collaboration_lnso",r={en:"This year the Grand Prix winning composition will be performed by the Lithuanian National Symphony Orchestra (LNSO) in the season 2022\u20132023.",lt:"\u0160i\u0173 met\u0173 konkurso Grand Prix laim\u0117tojo k\u016Brin\u012F 2022\u20132023 met\u0173 sezone atliks Lietuvos nacionalinis simfoninis orkestras (LNSO)."},l={en:"April 11<sup>th</sup>, 2022 - 8:00 pm",lt:"2022 m. baland\u017Eio 11 d. 20:00"},u={en:"Collaboration with LNSO",lt:"Bendradarbiavimas su LNSO"},p={full:{en:"<p>This year the Grand Prix winning composition will be performed by the Lithuanian National Symphony Orchestra (LNSO) in the season 2022\u20132023.</p><p>This exclusive opportunity is made possible by Mr. Modestas Pitrenas, Artistic Director and Principal Conductor of the LNSO, and Mrs. R\u016Bta Prusevi\u010Dien\u0117, General Director of the Lithuanian National Philharmonic Society.</p>",lt:"<p>\u0160i\u0173 met\u0173 konkurso Grand Prix laim\u0117tojo k\u016Brin\u012F 2022\u20132023 met\u0173 sezone atliks Lietuvos nacionalinis simfoninis orkestras (LNSO).</p><p>\u0160i\u0105 i\u0161skirtin\u0119 galimyb\u0119 dovanoja LNSO meno vadovas ir vyriausiasis dirigentas maestro Modestas Pitrenas bei Lietuvos nacionalin\u0117s filharmonijos generalin\u0117 direktor\u0117 ponia R\u016Bta Prusevi\u010Dien\u0117.</p>"}},m={small:"logo_lnf.png"};var xi={slug:n,meta:r,date:l,title:u,content:p,images:m},sa=Object.freeze({__proto__:null,[Symbol.toStringTag]:"Module",slug:n,meta:r,date:l,title:u,content:p,images:m,default:xi});const c="registration_end_22",h={en:"Registration to the 3rd Future Symphony Competition has finished. This year, 22 participants from 14 different countries have submitted their orchestral compositions.",lt:"Baig\u0117si registracija \u012F III \u201EFuture Symphony\u201C konkurs\u0105. \u0160iemet orkestrines kompozicijas atsiunt\u0117 22 dalyviai i\u0161 14 skirting\u0173 \u0161ali\u0173."},k={en:"July 1<sup>st</sup>, 2022 - 6:00 pm",lt:"2022 m. liepos 1 d. 18:00"},d={en:"Future Symphony '22 Begins!",lt:"Naujas konkursas prasideda!"},b={full:{en:"<p>Registration to the 3rd Future Symphony Competition has finished. This year, 22 participants from 14 different countries have submitted their orchestral compositions.</p><p>All the eligible scores were already sent to the 1<sup>st</sup> round jury for evaluation.</p><p>Members of the jury as well as <b>the 1<sup>st</sup> round results will be announced on July 20<sup>th</sup></b> here and at <a class='link' href='https://facebook.com/FScompetition'>www.facebook.com/FScompetition</a>.</p>",lt:"<p>Baig\u0117si registracija \u012F III \u201EFuture Symphony\u201C konkurs\u0105. \u0160iemet orkestrines kompozicijas atsiunt\u0117 22 dalyviai i\u0161 14 skirting\u0173 \u0161ali\u0173.</p><p>Visos nuostatus atitinkan\u010Dios partit\u016Bros jau pateiktos 1-o turo \u017Eiuri vertinimui.</p><p>\u017Diuri sud\u0117tis bei <b>1-o turo rezultatai bus skelbiami liepos 20 d.</b> \u0161ioje sveitain\u0117je bei <a class='link' href='https://facebook.com/FScompetition'>www.facebook.com/FScompetition</a>.</p>"}},g={regular:"registration_end_22.jpg",small:"registration_end_22_small.jpg"};var Vi={slug:c,meta:h,date:k,title:d,content:b,images:g},na=Object.freeze({__proto__:null,[Symbol.toStringTag]:"Module",slug:c,meta:h,date:k,title:d,content:b,images:g,default:Vi});const y="first_round_22",f={en:"We are excited to announce the finalists of the 3rd Future Symphony Competition! The chosen compositions will be premiered on September 9th, 6:30 p.m. at the Lithuanian National Philharmonic Hall.",lt:"Skelbiami III tarptautinio kompozicij\u0173 simfoniniam orkestrui konkurso \u201EFuture Symphony\u201C finalininkai. I\u0161rinktos kompozicijos bus atliktos baigiamajame konkurso koncerte rugs\u0117jo 9 d. 18:30 val. Lietuvos nacionalin\u0117je filharmonijoje."},j={en:"July 20<sup>th</sup>, 2022 - 12:00 pm",lt:"2022 m. liepos 20 d. 12:00"},v={en:"Announcement of the 1<sup>st</sup> Round Results",lt:"Paskelbti 1-o turo rezultatai"},_={short:{en:"<p>We are excited to announce the finalists of the 3<sup>rd</sup> Future Symphony Competition!</p><p>This year, 22 composers from 14 countries have submitted their scores. The five finalists were chosen by the 1st round jury committee. The chosen compositions will be premiered on <b>September 9<sup>th</sup>, 6:30 p.m.</b> at the Lithuanian National Philharmonic Hall.</p>",lt:"<p>Skelbiami III tarptautinio kompozicij\u0173 simfoniniam orkestrui konkurso \u201EFuture Symphony\u201C finalininkai.</p><p>Konkursui buvo pateiktos 22 partit\u016Bros i\u0161 14 skirting\u0173 \u0161ali\u0173. Penkis finalininkus i\u0161rinko 1-o turo \u017Eiuri. I\u0161rinktos kompozicijos bus atliktos baigiamajame konkurso koncerte <b>rugs\u0117jo 9 d. 18:30 val.</b> Lietuvos nacionalin\u0117je filharmonijoje.</p>"},full:{en:'<p>We are excited to announce the finalists of the 3<sup>rd</sup> Future Symphony Competition!</p><p><b>Jasper de Bock</b> (The Netherlands)<br><b>Lukas Butkus</b> (Lithuania)<br><b>Roman Czura</b> (Poland/Germany)<br><b>Dario Michelon</b> (Italy)<br><b>Przemys\u0142aw Scheller</b> (Poland)</p><p>This year, 22 composers from 14 countries have submitted their scores. The five finalists were chosen by the 1st round jury committee:</p><p><a href="http://www.baltakas.net/" class="link" target="_blank">Vykintas Baltakas</a> (chairman, Lithuania)<br><a href="http://janispetraskevics.com/" class="link" target="_blank">J\u0101nis Petra\u0161kevi\u010Ds</a> (Latvia)<br><a href="https://www.mic.lt/lt/baze/klasikine-siuolaikine/kompozitoriai/maciliunaite/" class="link" target="_blank">Rita Ma\u010Dili\u016Bnait\u0117</a> (Lithuania)<br><a href="https://www.kristoforas.lt/apie-mus/orkestro-vadovai/" class="link" target="_blank">Modestas Barkauskas</a> (Lithuania)</p><p>The chosen compositions will be premiered on <b>September 9<sup>th</sup>, 6:30 p.m.</b> at the Lithuanian National Philharmonic Hall.</p><hr><p><b>This project is financed by</b> the Lithuanian Council for Culture, Association LATGA and Vilnius City Municipality<br><b>Founding sponsor:</b> Mr. Gediminas Kuprevi\u010Dius<br><b>Main sponsor:</b> Lithuanian National Philharmonic Society<br><b>Sponsors:</b> Saulius Karosas Foundation, Cafe Grande<br><b>Informational sponsors:</b> LRT, IQ.The Economist<br><b>Partners:</b> CAFFEINE, Domus Maria Hotel, TRIPLENODE, Pirmoji Kava</p>',lt:'<p>Skelbiami III tarptautinio kompozicij\u0173 simfoniniam orkestrui konkurso \u201EFuture Symphony\u201C finalininkai:</p><p><b>Jasper de Bock</b> (Nyderlandai)<br><b>Lukas Butkus</b> (Lietuva)<br><b>Roman Czura</b> (Lenkija/Vokietija)<br><b>Dario Michelon</b> (Italija)<br><b>Przemys\u0142aw Scheller</b> (Lenkija)</p><p>Konkursui buvo pateiktos 22 partit\u016Bros i\u0161 14 skirting\u0173 \u0161ali\u0173. Penkis finalininkus i\u0161rinko 1-o turo \u017Eiuri:</p><p><a href="http://www.baltakas.net/" class="link" target="_blank">Vykintas Baltakas</a> (chairman, Lithuania)<br><a href="http://janispetraskevics.com/" class="link" target="_blank">J\u0101nis Petra\u0161kevi\u010Ds</a> (Latvia)<br><a href="https://www.mic.lt/lt/baze/klasikine-siuolaikine/kompozitoriai/maciliunaite/" class="link" target="_blank">Rita Ma\u010Dili\u016Bnait\u0117</a> (Lithuania)<br><a href="https://www.kristoforas.lt/apie-mus/orkestro-vadovai/" class="link" target="_blank">Modestas Barkauskas</a> (Lithuania)</p><p>I\u0161rinktos kompozicijos bus atliktos baigiamajame konkurso koncerte <b>rugs\u0117jo 9 d. 18:30 val.</b> Lietuvos nacionalin\u0117je filharmonijoje.</p><hr><p><b>Projekt\u0105 finansuoja</b> Lietuvos kult\u016Bros taryba, asociacija LATGA, Vilniaus miesto savivaldyb\u0117<br><b>Konkurso mecenatas:</b> Gediminas Kuprevi\u010Dius<br><b>Pagrindinis r\u0117m\u0117jas:</b> Lietuvos nacionalin\u0117 filharmonija<br><b>R\u0117m\u0117jai:</b> Sauliaus Karoso fondas, Cafe Grande<br><b>Informaciniai r\u0117m\u0117jai:</b> LRT, IQ.The Economist<br><b>Partneriai:</b> CAFFEINE, Vie\u0161butis Domus Maria, TRIPLENODE, Pirmoji Kava</p>'}},S={regular:"",small:"first_round_22.png"};var Wi={slug:y,meta:f,date:j,title:v,content:_,images:S},ra=Object.freeze({__proto__:null,[Symbol.toStringTag]:"Module",slug:y,meta:f,date:j,title:v,content:_,images:S,default:Wi});const w="important_update",T={en:"The organizational committee has noticed a severe violation of the Regulations of the Competition (article IX, the principle of anonymity) that resulted in the disqualification of Dario Michelon (Italy) from the competition.",lt:"Konkurso organizatoriams u\u017Efiksavus grub\u0173 Konkurso nuostat\u0173 pa\u017Eeidim\u0105 (IX straipsnis, anonimi\u0161kumo s\u0105lyga), i\u0161 konkurso diskvalifikuojamas Dario Michelonas (Italija)."},z={en:"July 25<sup>th</sup>, 2022 - 2:00 pm",lt:"2022 m. liepos 25 d. 14:00"},F={en:"Important Update",lt:"Svarbi Informacija"},L={full:{en:"<p>The organizational committee has noticed a severe violation of the Regulations of the Competition (article IX, the principle of anonymity) that resulted in the disqualification of Dario Michelon (Italy) from the competition.</p><p>The investigation of the incident revealed that the title of Michelon's composition was publicly disclosed due to the negligence of a third person, who has a pedagogical relation with the former finalist. We would like to announce that David Roche (United Kingdom) becomes the new finalist in the competition. His composition will be performed at the final concert and will compete for the prizes.</p><p>Team FS would like to emphasize that the principle of anonymity is to be strictly maintained throughout the competition until the award ceremony.</p>",lt:"<p>Konkurso organizatoriams u\u017Efiksavus grub\u0173 Konkurso nuostat\u0173 pa\u017Eeidim\u0105 (IX straipsnis, anonimi\u0161kumo s\u0105lyga), i\u0161 konkurso diskvalifikuojamas Dario Michelonas (Italija).</p><p>\u012Evykio tyrimas parod\u0117, jog Michelono k\u016Brinio pavadinimo pavie\u0161inimas \u012Fvyko d\u0117l pedagoginiais ry\u0161iais su buvusiu finalininku susijusio tre\u010Diojo asmens aplaidumo. Skelbiame, jog laisv\u0105 finalininko viet\u0105 u\u017Eima Davidas Roche'as (Jungtin\u0117 Karalyst\u0117). Jo k\u016Brinys bus atliktas baigiamajame koncerte ir var\u017Eysis d\u0117l konkurso priz\u0173.</p><p>FS Komanda pabr\u0117\u017Eia, jog k\u016Brini\u0173 anonimi\u0161kumo s\u0105lyga galioja viso konkurso metu iki pat apdovanojim\u0173 ceremonijos.</p>"}},A={regular:"",small:"important_update_small.jpg"};var Ei={slug:w,meta:T,date:z,title:F,content:L,images:A},la=Object.freeze({__proto__:null,[Symbol.toStringTag]:"Module",slug:w,meta:T,date:z,title:F,content:L,images:A,default:Ei});const C="finalists_22",M={en:"Meet the finalists of Future Symphony Competition 2022!",lt:"Susipa\u017Einkite su 2022 m. \u201EFuture Symphony\u201C konkurso finalininkais!"},I={en:"August 23<sup>rd</sup>, 2022 - 8:00 pm",lt:"2022 m. rugpj\u016B\u010Dio 23 d. 20:00"},$={en:"Meet the finalists of FSC'22!",lt:"Susipa\u017Einkite su FSC'22 finalininkais!"},R={full:{en:"<p>The finalists of this years edition of the Future Symphony Competition hail from five different european countries:</p><p>The Netherlands \u{1F1F3}\u{1F1F1} \u2013 Lithuania \u{1F1F1}\u{1F1F9} \u2013 Poland \u{1F1F5}\u{1F1F1} \u2013 Germany \u{1F1E9}\u{1F1EA} \u2013 United Kingdom \u{1F1EC}\u{1F1E7} / Wales \u{1F3F4}\u{E0067}\u{E0062}\u{E0077}\u{E006C}\u{E0073}\u{E007F}</p><p>The musicians of <a class='link' href='/#FSO'>Future Symphony Orchestra</a> are already rehearsing the five pieces that will be premiered on the 9<sup>th</sup> of September in the Lithuanian National Philharmonic in Vilnius (Invitations to the final concert are available <a class='link' href='https://tickets.paysera.com/en/event/konkursas-future-symphony-baigiamasis-koncertas' target='_blank'>here</a>).</p><p>Meanwhile, we invite you to get acquainted with <b>the authors' biographies</b> which you will find at: <div style='text-align: center; margin-top: 25px'><b><a href='/finalists' class='link'>www.futuresymphony.lt/finalists</a></b></div></p>",lt:"<p>\u0160i\u0173 met\u0173 \u201EFuture Symphony\u201C konkurso finalininkai kil\u0119 i\u0161 penki\u0173 skirting\u0173 Europos \u0161ali\u0173:</p><p>Nyderland\u0173 \u{1F1F3}\u{1F1F1} \u2013 Lietuvos \u{1F1F1}\u{1F1F9} \u2013 Lenkijos \u{1F1F5}\u{1F1F1} \u2013 Vokietijos \u{1F1E9}\u{1F1EA} \u2013 Jungtin\u0117s Karalyst\u0117s \u{1F1EC}\u{1F1E7} / Velso \u{1F3F4}\u{E0067}\u{E0062}\u{E0077}\u{E006C}\u{E0073}\u{E007F}</p><p><a class='link' href='/#FSO'>Future Symphony Orchestra</a> atlik\u0117jai jau repetuoja 5 kompozicijas, kuri\u0173 premjeras gal\u0117site i\u0161girsti rugs\u0117jo 9 d. Lietuvos nacionalin\u0117je filharmonijoje Vilniuje (kvietimai \u012F nemokam\u0105 koncert\u0105 \u2013 <a class='link' href='https://tickets.paysera.com/lt/event/konkursas-future-symphony-baigiamasis-koncertas' target='_blank'>\u010Dia</a>).</p><p>O belaukiant koncerto, kvie\u010Diame susipa\u017Einti su k\u016Brini\u0173 autoriais \u2013 <b>j\u0173 biografijas rasite \u010Dia</b>: <div style='text-align: center; margin-top: 25px'><b><a href='/finalists' class='link'>www.futuresymphony.lt/finalists</a></b></div></p>"}},P={regular:"meet_the_finalists.jpg",small:"meet_the_finalists_small.jpg"};var Ui={slug:C,meta:M,date:I,title:$,content:R,images:P},ua=Object.freeze({__proto__:null,[Symbol.toStringTag]:"Module",slug:C,meta:M,date:I,title:$,content:R,images:P,default:Ui});const K="sold_out",J={en:"Tickets to the final concert of the Competition are sold out! The premiere evening is tomorrow, September 9th, the concert will start at 6:30 p.m.",lt:"Visi bilietai \u012F \u201EFuture Symphony\u201C finalin\u012F koncert\u0105 i\u0161parduoti! Premjerinis vakaras jau rytoj, rugs\u0117jo 9 d. - koncertas prasideda 18:30 val."},O={en:"September 8<sup>th</sup>, 2022 - 6:00 pm",lt:"2022 m. rugs\u0117jo 8 d. 18:00"},N={en:"Live Stream of the FSC'22 Final Concert",lt:"Tiesiogin\u0117 FSC'22 finalinio koncerto transliacija"},B={full:{en:"<p>Tickets to the final concert of the Competition are sold out! The premiere evening is tomorrow, September 9<sup>th</sup>, the concert will start at 6:30 p.m.</p><p>For those who did not manage to register for tickets, we will organize a live broadcast &ndash; starting tomorrow at 5:30 p.m. you will find it at the top of our page at <div style='text-align: center; margin: 20px 0'><b><a href='/' class='link'>www.futuresymphony.lt</a></b></div> Later, a recording of the concert will be played on the air of the official broadcaster of the competition, <a class='link' href='https://www.lrt.lt/mediateka/tiesiogiai/lrt-klasika' target='_blank'>LRT KLASIKA</a>. We look forward to meeting you live or on the airwaves!</p><hr><p><b>This project is financed by</b> the Lithuanian Council for Culture, Association LATGA and Vilnius City Municipality. <b>Founding sponsor:</b> Mr. Gediminas Kuprevi\u010Dius.</p>",lt:"<p>Visi bilietai \u012F \u201EFuture Symphony\u201C finalin\u012F koncert\u0105 i\u0161parduoti! Premjerinis vakaras jau rytoj, rugs\u0117jo 9 d. &ndash; koncertas prasideda 18:30 val.</p><p>Nesp\u0117jusiems \u012Fsigyti biliet\u0173, rengsime tiesiogin\u0119  transliacij\u0105 \u2013 nuo rytojaus 17:30 val. j\u0105 rasite puslapyje <div style='text-align: center; margin: 20px 0'><b><a href='/' class='link'>www.futuresymphony.lt</a></b></div> V\u0117liau koncerto \u012Fra\u0161as skamb\u0117s ir oficialaus konkurso transliuotojo <a class='link' href='https://www.lrt.lt/mediateka/tiesiogiai/lrt-klasika' target='_blank'>LRT KLASIKA</a> eteryje. Nekantriai laukiame susitikimo su Jumis gyvai ar eterio bangomis!</p><hr><p><b>Projekt\u0105 finansuoja</b> Lietuvos kult\u016Bros taryba, asociacija LATGA, Vilniaus miesto savivaldyb\u0117. <b>Konkurso mecenatas:</b> Gediminas Kuprevi\u010Dius.</p>"}},D={regular:"sold_out.jpg",small:"sold_out_small.jpg"};var Hi={slug:K,meta:J,date:O,title:N,content:B,images:D},pa=Object.freeze({__proto__:null,[Symbol.toStringTag]:"Module",slug:K,meta:J,date:O,title:N,content:B,images:D,default:Hi});const G="results_final_22",x={en:"On September 9th, the final concert of the 3rd International Music Composition Competition for Symphony Orchestra \u201CFuture Symphony\u201C took place at the Lithuanian National Philharmonic Hall. Five world premieres were performed by Future Symphony Orchestra, conducted by Adomas Mork\u016Bnas-Budrys. The Grand Prix \u2013 Jasper de Bock (The Netherlands) with the composition \u201EWas auch geschieht?\u201C.",lt:"Rugs\u0117jo 9 d. Lietuvos nacionalin\u0117je filharmonijoje \u012Fvyko III tarptautinio kompozicij\u0173 simfoniniam orkestrui konkurso \u201EFuture Symphony\u201C finalinis koncertas. Penkias pasaulines jaun\u0173j\u0173 kompozitori\u0173 premjeras atliko specialiai konkursui suburiamas Future Symphony Orchestra (dirigentas Adomas Mork\u016Bnas-Budrys). Konkurso Grand Prix peln\u0117 Jasperas de Bockas (Nyderlandai) su k\u016Briniu \u201EWas auch geschieht?\u201C."},V={en:"September 11<sup>th</sup>, 2022 - 10:00 pm",lt:"2022 m. rugs\u0117jo 9 d. 22:00"},W={en:"Results of the FSC'22 Final Round",lt:"FSC'22 finalinio turo rezultatai"},E={full:{en:"<p>On September 9<sup>th</sup>, the final concert of the 3<sup>rd</sup> International Music Composition Competition for Symphony Orchestra \u201CFuture Symphony\u201C took place at the Lithuanian National Philharmonic Hall. Five world premieres were performed by <i><a class='link' href='/#FSO'>Future Symphony Orchestra</a></i>, conducted by Adomas Mork\u016Bnas-Budrys.</p><p><b>The Grand Prix</b> \u2013 Jasper de Bock (The Netherlands \u{1F1F3}\u{1F1F1}) with the composition <a class='link' href='https://youtu.be/26FCkA2liTU?t=4715' target='_blank'>\u201EWas auch geschieht?\u201C</a>. The Composer received a 1500 \u20AC cash prize. His composition is going to be performed once more by the Lithuanian National Symphony Orchestra (Artistic Director and Chief Conductor Modestas Pitr\u0117nas).</p><p><b>Laureate diplomas</b> \u2013 Roman Czura (Poland \u{1F1F5}\u{1F1F1} / Germany \u{1F1E9}\u{1F1EA}) with the composition <a class='link' href='https://youtu.be/26FCkA2liTU?t=2290' target='_blank'>\u201EBlack is Black\u201C</a> & Przemys\u0142aw Scheller with the composition <a class='link' href='https://youtu.be/26FCkA2liTU?t=3970' target='_blank'>\u201EBeyond the Threshold\u201C</a>. The two shared the prize pool of 1500 \u20AC in equal parts.</p><p><b>Saulius Karosas Foundation Special Prize</b> \u201Cfor the best Lithuanian author\u201D \u2013 Lukas Butkus (Lithuania \u{1F1F1}\u{1F1F9}) with the composition <a class='link' href='https://youtu.be/26FCkA2liTU?t=1480' target='_blank'>\u201EAgalma\u201C</a>.</p><p><b>Audience Sympathy Prize</b> \u2013 David John Roche (United Kingdom \u{1F1EC}\u{1F1E7} / Wales \u{1F3F4}\u{E0067}\u{E0062}\u{E0077}\u{E006C}\u{E0073}\u{E007F}) with the composition <a class='link' href='https://youtu.be/26FCkA2liTU?t=3015' target='_blank'>\u201EEdges of Sincerity\u201C</a>.</p><p><b><i>Future Symphony Orchestra</i> Sympathy Prize</b> \u2013 Jasper de Bock (The Netherlands \u{1F1F3}\u{1F1F1}) with the composition <a class='link' href='https://youtu.be/26FCkA2liTU?t=4715' target='_blank'>\u201EWas auch geschieht?\u201C</a>.</p><p>The 3<sup>rd</sup> Future Symphony Competition has received 22 scores from 14 different countries: Australia, China, Denmark, Estonia, Georgia, Israel, Italy, Lithuania, Mexico, The Netherlands, Poland, United Kingdom and United States of America.</p><p>Compositions for the final concert were selected by the <b>1<sup>st</sup> round jury committee</b>: composer and conductor Vykintas Baltakas (chairman, Lithuania), composer J\u0101nis Petra\u0161kevi\u010Ds (Latvia), conductor Modestas Barkauskas (Lithuania) and composer Rita Ma\u010Dili\u016Bnait\u0117 (Lithuania).</p><p>Winners were selected by the <b>2<sup>nd</sup> round jury committee</b>: composer and musicologist M\u0101rti\u0146\u0161 Vi\u013Cums (chairman, Latvia/Lithuania), composer and sound artist Yannis Kyriakides, composer and musicologist Just\u0117 Janulyt\u0117 (Lithuania), conductor Modestas Pitr\u0117nas (Lithuania), composer and pianist Ayal Adler (Israel) and conductor and composer Gediminas Gelgotas (Lithuania).</p><p>The live broadcast of the final concert from the Lithuanian National Philharmonic Hall can be rewatched on <a class='link' href='https://youtu.be/26FCkA2liTU?t=810' target='_blank'>our YouTube channel</a>. Furthermore, the concert recording will be broadcast by LRT KLASIKA.</p>",lt:"<p>Rugs\u0117jo 9 d. Lietuvos nacionalin\u0117je filharmonijoje \u012Fvyko III tarptautinio kompozicij\u0173 simfoniniam orkestrui konkurso \u201EFuture Symphony\u201C finalinis koncertas. Penkias pasaulines jaun\u0173j\u0173 kompozitori\u0173 premjeras atliko specialiai konkursui suburiamas <i><a class='link' href='/#FSO'>Future Symphony Orchestra</a></i> (dirigentas Adomas Mork\u016Bnas-Budrys).</p><p><b>Konkurso Grand Prix</b> peln\u0117 Jasperas de Bockas (Nyderlandai \u{1F1F3}\u{1F1F1}) su k\u016Briniu <a class='link' href='https://youtu.be/26FCkA2liTU?t=4715' target='_blank'>\u201EWas auch geschieht?\u201C</a> (liet. Kad ir kas nutinka). Kompozitoriui atiteko 1500 \u20AC piniginis prizas ir pakartotinis k\u016Brinio atlikimas Lietuvos nacionalinio simfoninio orkestro (meno vadovas ir vyr. dirigentas Modestas Pitr\u0117nas) koncert\u0173 sezone.</p><p><b>Konkurso laureatais</b> tapo Romanas Czura (Lenkija \u{1F1F5}\u{1F1F1} / Vokietija \u{1F1E9}\u{1F1EA}) u\u017E k\u016Brin\u012F <a class='link' href='https://youtu.be/26FCkA2liTU?t=2290' target='_blank'>\u201EBlack is Black\u201C</a> (liet. Juoda yra juoda) bei Przemys\u0142awas Schelleris u\u017E k\u016Brin\u012F <a class='link' href='https://youtu.be/26FCkA2liTU?t=3970' target='_blank'>\u201EBeyond the Threshold\u201C</a> (liet. Anapus slenks\u010Dio). Jie lygiomis dalimis pasidalino 1500 \u20AC prizin\u012F fond\u0105.</p><p><b>Sauliaus Karoso labdaros ir paramos fondo prizu</b> \u201Eu\u017E geriausi\u0105 lietuvi\u0173 autoriaus k\u016Brin\u012F\u201C apdovanotas kompozicijos <a class='link' href='https://youtu.be/26FCkA2liTU?t=1480' target='_blank'>\u201EAgalma\u201C</a> autorius Lukas Butkus (Lietuva \u{1F1F1}\u{1F1F9}).</p><p><b>Publikos simpatij\u0173 prizas</b> atiteko Davidui Johnui Roche\u2018ui (Jungtin\u0117 Karalyst\u0117 \u{1F1EC}\u{1F1E7} / Velsas \u{1F3F4}\u{E0067}\u{E0062}\u{E0077}\u{E006C}\u{E0073}\u{E007F}) u\u017E kompozicij\u0105 <a class='link' href='https://youtu.be/26FCkA2liTU?t=3015' target='_blank'>\u201EEdges of Sincerity\u201C</a> (liet. Tikrumo pakra\u0161\u010Diai).</p><p><b>Future Symphony Orchestra simpatij\u0173 priz\u0105</b> peln\u0117 konkurso laim\u0117tojas Jasperas de Bockas (Nyderlandai \u{1F1F3}\u{1F1F1}) su k\u016Briniu <a class='link' href='https://youtu.be/26FCkA2liTU?t=4715' target='_blank'>\u201EWas auch geschieht?\u201C</a>.</p><p>Tre\u010Diajam \u201EFuture Symphony\u201C konkursui buvo pateiktos 22 partit\u016Bros i\u0161 14 \u0161ali\u0173: Australijos, Kinijos, Danijos, Estijos, Sakartvelo, Vokietijos, Izraelio, Italijos, Lietuvos, Meksikos, Nyderland\u0173, Lenkijos, Jungtin\u0117s Karalyst\u0117s ir Jungtini\u0173 Amerikos Valstij\u0173.</p><p>Finaliniam koncertui k\u016Brinius atrinko <b>1-o turo \u017Eiuri</b>: kompozitorius ir dirigentas Vykintas Baltakas (pirmininkas), kompozitorius J\u0101nis Petra\u0161kevi\u010Ds (Latvija), dirigentas Modestas Barkauskas, kompozitor\u0117 Rita Ma\u010Dili\u016Bnait\u0117.</p><p>Konkurso finalinio koncerto metu nugal\u0117tojus rinko <b>2-o turo \u017Eiuri</b>: kompozitorius ir muzikologas M\u0101rti\u0146\u0161 Vi\u013Cums (Latvija/Lietuva, pirmininkas), kompozitorius ir garso menininkas Yannis Kyriakides (Kipras/Nyderlandai), kompozitor\u0117 ir muzikolog\u0117 Just\u0117 Janulyt\u0117 (Lietuva/Italija), dirigentas Modestas Pitr\u0117nas, kompozitorius Ayal Adler (Izraelis) bei kompozitorius ir dirigentas Gediminas Gelgotas.</p><p>Tiesiogin\u0119 finalinio koncerto transliacij\u0105 i\u0161 Lietuvos nacionalin\u0117s filharmonijos galima dar kart\u0105 steb\u0117ti <a class='link' href='https://youtu.be/26FCkA2liTU?t=810' target='_blank'>m\u016Bs\u0173 YouTube kanale</a>. Taip pat \u201EFuture Symphony\u201C koncerto \u012Fra\u0161\u0105 jau greitai bus galima i\u0161girsti oficialaus konkurso transliuotojo LRT KLASIKOS eteryje.</p>"}},U={regular:"jasper_de_bock.jpg",small:"jasper_de_bock_small.jpg"};var Qi={slug:G,meta:x,date:V,title:W,content:E,images:U},ma=Object.freeze({__proto__:null,[Symbol.toStringTag]:"Module",slug:G,meta:x,date:V,title:W,content:E,images:U,default:Qi});const H="registration",Q={en:'Registration to the "Future Symphony" competition starts in February',lt:"Registracijos \u012F \u201EFuture Symphony\u201C konkurs\u0105 prad\u017Eia"},q={en:"January 18<sup>th</sup>, 2020 - 3:00 pm",lt:"2020 m. sausio 18 d. 15:00"},X={en:'Registration to the "Future Symphony" Competition Starts in February',lt:"Registracijos \u012F \u201EFuture Symphony\u201C konkurs\u0105 prad\u017Eia"},Y={full:{en:'<p>We are delighted to announce the registration to the 2<sup>nd</sup> international music composition competition for symphony orchestra "Future Symphony". Applications are welcome <b>from February 5th until June 5th 2020</b>. Composers from all around the world at the age of 18-35 can apply to the competition.</p>',lt:"<p>Mes d\u017Eiaugiam\u0117s gal\u0117dami paskelbti registracij\u0105 \u012F II tarptautin\u012F kompozicij\u0173 simfoniniam orkestrui konkurs\u0105 \u201EFuture Symphony\u201C. Anketos priimamos <b>nuo 2020 m. vasario 5 d. iki bir\u017Eelio 5 d</b>. \u012E konkurs\u0105 registruotis gali 18-35 m. kompozitoriai i\u0161 viso pasaulio.</p>"}},Z={regular:"logo_news.png",small:"logo_news_small.png"};var qi={slug:H,meta:Q,date:q,title:X,content:Y,images:Z},ca=Object.freeze({__proto__:null,[Symbol.toStringTag]:"Module",slug:H,meta:Q,date:q,title:X,content:Y,images:Z,default:qi});const ii="registration_open",ai={en:"Registration starts now, final instrumentation is announced!",lt:"Skelbiama registracijos prad\u017Eia ir galutin\u0117 instrumentuot\u0117!"},ti={en:"February 5<sup>th</sup>, 2020 - 5:00 pm",lt:"2020 m. vasario 5 d. 17:00"},ei={en:"Registration Starts Now, Final Instrumentation is Announced!",lt:"Skelbiama registracijos prad\u017Eia ir galutin\u0117 instrumentuot\u0117!"},oi={full:{en:'<p>We are excited to announce that the registration to the \u201EFuture Symphony\u201D competition is now open! Applications from all over the world are welcome till the <b>5<sup>th</sup> of June 2020</b>. Register <a href="/#participants" class="link">here</a> now! We would like to remind you that application fee until the 5<sup>th</sup> of April 2020 is 50 eur, from April 6<sup>th</sup> 2020 onwards is 80 EUR.</p><p>Also we inform you about the slight changes of the orchestration for the application score. You can find the final instrumentation limits for this years competition <a href="/files/orchestration_2020.txt" class="link" download>here</a>.</p>',lt:'<p>Mes d\u017Eiaugiam\u0117s gal\u0117dami paskelbti registracijos prad\u017Ei\u0105 \u012F \u201EFuture Symphony\u201C konkurs\u0105! \u012E j\u012F gali <a href="/#participants" class="link">registruotis</a> kompozitoriai i\u0161 viso pasaulio iki <b>2020 m. bir\u017Eelio 5 d.</b> Norime priminti, kad kompozitoriams, u\u017Esiregistravusiems iki 2020 m. baland\u017Eio 5 d. 23:59 Lietuvos laiku (EEST), dalyvio mokestis \u2013 50 Eur, o nuo baland\u017Eio 6 d. \u2013 80 Eur.</p><p>Taip pat informuojame apie ne\u017Eymius instrumentuot\u0117s konkurso k\u016Briniams pakitimus. Kartu su registracijos prad\u017Eia skelbiame galutin\u0119 orkestro sud\u0117t\u012F kuria rasite <a href="/files/orchestration_2020.txt" class="link" download>\u010Dia</a>.</p>'}},si={regular:"registration.jpg",small:"registration_small.jpg"};var Xi={slug:ii,meta:ai,date:ti,title:ei,content:oi,images:si},ha=Object.freeze({__proto__:null,[Symbol.toStringTag]:"Module",slug:ii,meta:ai,date:ti,title:ei,content:oi,images:si,default:Xi});const ni="corona",ri={en:"COVID-19 doesn't affect the Future Symphony Competition",lt:"Nepaisant COVID-19, konkurso visi etapai vyks pagal plan\u0105"},li={en:"March 17<sup>th</sup>, 2020 - 8:00 pm",lt:"2020 m. kovo 17 d. 20:00"},ui={en:"Coronavirus",lt:"Koronavirusas"},pi={full:{en:"<p>We would like to inform you that COVID-19 doesn't affect the Future Symphony Competition. We encourage young composers all over the world to keep writing a symphonic piece for the contest!</p><p>Quick reminder: registration is open until 5<sup>th</sup> of June 2020, with an application fee discount till 5<sup>th</sup> of April 2020!</p>",lt:"<p>Norime prane\u0161ti, kad, nepaisant COVID-19, konkurso visi etapai vyks pagal plan\u0105. Tod\u0117l raginame jaunuosius kompozitorius i\u0161 viso pasaulio toliau ra\u0161yti simfonin\u012F k\u016Brin\u012F konkursui!</p><p>Primename, kad registracija atidaryta iki 2020 m. bir\u017Eelio 5 d. su galimybe gauti registracijos nuolaid\u0105 iki 2020 m. baland\u017Eio 5 d.!</p>"}},mi={regular:"corona.png",small:"corona_small.png"};var Yi={slug:ni,meta:ri,date:li,title:ui,content:pi,images:mi},ka=Object.freeze({__proto__:null,[Symbol.toStringTag]:"Module",slug:ni,meta:ri,date:li,title:ui,content:pi,images:mi,default:Yi});const ci="registration_end",hi={en:"Registration to the 2nd Future Symphony Competition has finished.",lt:"Baig\u0117si registracija \u012F II-\u0105j\u012F \u201EFuture Symphony\u201C konkurs\u0105"},ki={en:"June 6<sup>th</sup>, 2020 - 9:30 pm",lt:"2020 m. bir\u017Eelio 6 d. 21:30"},di={en:"End of Registration",lt:"Registracijos pabaiga"},bi={full:{en:"<p>Registration to the 2nd Future Symphony Competition has finished. We are very excited that the competition has gathered composers from even 20 different countries!</p><p>\u{1F1E6}\u{1F1F7} \u{1F1E6}\u{1F1FA} \u{1F1E8}\u{1F1F3} \u{1F1E9}\u{1F1F0} \u{1F1EB}\u{1F1F7} \u{1F1E9}\u{1F1EA} \u{1F1EC}\u{1F1F7} \u{1F1ED}\u{1F1F0} \u{1F1ED}\u{1F1FA} \u{1F1EE}\u{1F1F7} \u{1F1EE}\u{1F1F9} \u{1F1EF}\u{1F1F5} \u{1F1F1}\u{1F1F9} \u{1F1F2}\u{1F1F9} \u{1F1F2}\u{1F1FD} \u{1F1F5}\u{1F1EA} \u{1F1F5}\u{1F1F1} \u{1F1EA}\u{1F1F8} \u{1F1EC}\u{1F1E7} \u{1F1FA}\u{1F1F8}</p><p>Contestants who have already received confirmation emails will have to submit their scores to the registration platform by the 5th of July. The deadline will be followed by the 1st round of the competition. Its results will be announced by the 20th of July.</p>",lt:"<p>Baig\u0117si registracija \u012F II-\u0105j\u012F \u201EFuture Symphony\u201C konkurs\u0105. Labai d\u017Eiaugiam\u0117s sulauk\u0119 parai\u0161k\u0173 net i\u0161 20 skirting\u0173 \u0161ali\u0173!</p><p>\u{1F1E6}\u{1F1F7} \u{1F1E6}\u{1F1FA} \u{1F1E8}\u{1F1F3} \u{1F1E9}\u{1F1F0} \u{1F1EB}\u{1F1F7} \u{1F1E9}\u{1F1EA} \u{1F1EC}\u{1F1F7} \u{1F1ED}\u{1F1F0} \u{1F1ED}\u{1F1FA} \u{1F1EE}\u{1F1F7} \u{1F1EE}\u{1F1F9} \u{1F1EF}\u{1F1F5} \u{1F1F1}\u{1F1F9} \u{1F1F2}\u{1F1F9} \u{1F1F2}\u{1F1FD} \u{1F1F5}\u{1F1EA} \u{1F1F5}\u{1F1F1} \u{1F1EA}\u{1F1F8} \u{1F1EC}\u{1F1E7} \u{1F1FA}\u{1F1F8}</p><p>Konkurso dalyviai tur\u0117s pateikti savo k\u016Brini\u0173 partit\u016Bras registracijos platformoje iki liepos 5 d. I\u0161kart po to vyks 1-asis konkurso turas. Jo rezultatai bus paskelbti liepos 20 d.</p>"}},gi={regular:"logo_news.png",small:"logo_news_small.png"};var Zi={slug:ci,meta:hi,date:ki,title:di,content:bi,images:gi},da=Object.freeze({__proto__:null,[Symbol.toStringTag]:"Module",slug:ci,meta:hi,date:ki,title:di,content:bi,images:gi,default:Zi});const yi="karoso",fi={en:"Best Lithuanian composer this year will be awarded with a special prize!",lt:"Geriausias 2020 m. konkurso kompozitorius i\u0161 Lietuvos bus apdovanotas specialiu prizu!"},ji={en:"July 11<sup>th</sup>, 2020 - 4:00 pm",lt:"2020 m. liepos 11 d. 16:00"},vi={en:"Special Prize for the Best Lithuanian Composition",lt:"Sauliaus Karoso fondo \u012Fsteigtas specialius prizas"},_i={full:{en:"<p>Future Symphony Competition supports young Lithuanian composers. Therefore, the best Lithuanian composer this year will be awarded with a special prize founded by the competition\u2019s main sponsor Saulius Karosas Foundation! \u{1F1F1}\u{1F1F9}</p>",lt:"<p>\u201EFuture Symphony\u201D konkursas \u2013 jaunuosius lietuvi\u0173 k\u016Br\u0117jus palaikanti iniciatyva. Tod\u0117l geriausias 2020 m. konkurso kompozitorius i\u0161 Lietuvos bus apdovanotas pagrindinio konkurso r\u0117m\u0117jo Sauliaus Karoso fondo \u012Fsteigtu specialiu prizu \u201Eu\u017E geriausi\u0105 lietuvi\u0173 autoriaus k\u016Brin\u012F\u201C! \u{1F1F1}\u{1F1F9}</p>"}},Si={regular:"",small:"karoso.png"};var ia={slug:yi,meta:fi,date:ji,title:vi,content:_i,images:Si},ba=Object.freeze({__proto__:null,[Symbol.toStringTag]:"Module",slug:yi,meta:fi,date:ji,title:vi,content:_i,images:Si,default:ia});const wi="first_round",Ti={en:"We are excited to announce 7 finalists of the 2nd Future Symphony Competition!",lt:"Skelbiame II-ojo \u201EFuture Symphony\u201C konkurso finalinink\u0173 s\u0105ra\u0161\u0105!"},zi={en:"July 20<sup>th</sup>, 2020 - 10:00 pm",lt:"2020 m. liepos 20 d. 22:00"},Fi={en:"Results of the 1<sup>st</sup> Round",lt:"I-ojo turo rezultatai"},Li={full:{en:"<p>We are excited to announce 7 finalists of the 2<sup>nd</sup> Future Symphony Competition! Participants listed below proceed to the 2<sup>nd</sup> round of the competition:</p><p>\u{1F1F5}\u{1F1F1}\u{1F1E9}\u{1F1EA} Roman Czura<br>\u{1F1F2}\u{1F1FD} Charles Philip Daniels Torres<br>\u{1F1F1}\u{1F1F9} Jievaras Jasinskis<br>\u{1F1F1}\u{1F1F9} Andrius Maslekovas<br>\u{1F1ED}\u{1F1FA} Apor Szu\u0308ts<br>\u{1F1EE}\u{1F1F9} Daniele Testa<br>\u{1F1EC}\u{1F1F7} Miran Tsalikian</p><p>Congratulations to the composers! Their compositions will be performed in a concert on the 17<sup>th</sup> of September at Lithuanian National Philharmonic Hall in Vilnius.</p><p>1<sup>st</sup> round\u2019s jury members were:</p><p>\u017Dibuokl\u0117 Martinaityt\u0117<br>Mykolas Natalevi\u010Dius<br>Karolis Variakojis</p><p>30 applications from even 20 different countries have been received for the 1<sup>st</sup> round.</p>",lt:"<p>Skelbiame II-ojo \u201EFuture Symphony\u201C finalinink\u0173 s\u0105ra\u0161\u0105! \u0160ie dalyviai patenka \u012F 2-\u0105j\u012F konkurso tur\u0105:</p><p>\u{1F1F5}\u{1F1F1}\u{1F1E9}\u{1F1EA} Roman Czura<br>\u{1F1F2}\u{1F1FD} Charles Philip Daniels Torres<br>\u{1F1F1}\u{1F1F9} Jievaras Jasinskis<br>\u{1F1F1}\u{1F1F9} Andrius Maslekovas<br>\u{1F1ED}\u{1F1FA} Apor Szu\u0308ts<br>\u{1F1EE}\u{1F1F9} Daniele Testa<br>\u{1F1EC}\u{1F1F7} Miran Tsalikian</p><p>Sveikiname kompozitorius! J\u0173 k\u016Briniai bus atlikti baigiamojo konkurso koncerto metu rugs\u0117jo 17 d. Lietuvos nacionalin\u0117je filharmonijoje.</p><p>1-ojo turo \u017Eiuri nariai:</p><p>\u017Dibuokl\u0117 Martinaityt\u0117<br>Mykolas Natalevi\u010Dius<br>Karolis Variakojis</p><p>1-ojo turo metu parai\u0161kas pateik\u0117 net 30 kompozitori\u0173 i\u0161 20 skirting\u0173 \u0161ali\u0173.</p>"}},Ai={regular:"first_round.jpg",small:"first_round_small.jpg"};var aa={slug:wi,meta:Ti,date:zi,title:Fi,content:Li,images:Ai},ga=Object.freeze({__proto__:null,[Symbol.toStringTag]:"Module",slug:wi,meta:Ti,date:zi,title:Fi,content:Li,images:Ai,default:aa});const Ci="final_round",Mi={en:'We are excited to announce the winners of the 2nd international music composition competition "Future Symphony"!',lt:"D\u017Eiaugsmingai prane\u0161ame II-ojo tarptautinio kompozicij\u0173 simfoniniam orkestrui konkurso rezultatus!"},Ii={en:"September 18<sup>th</sup>, 2020 - 7:00 pm",lt:"2020 m. rugs\u0117jo 18 d. 19:00"},$i={en:"Results of the Final Round of FSC'20",lt:"FSC'20 finalinio turo rezultatai"},Ri={full:{en:'<p>We are excited to announce the winners of the 2<sup>nd</sup> international music composition competition "Future Symphony"!</p><p><b>1<sup>st</sup> place:</b><br><a class="link" target="blank" href="https://youtu.be/Mng62a6KlJ4">\u{1F1F2}\u{1F1FD} Charles Philip Daniels Torres ("The Myth of De\u0301remot-Be\u0301lel")</a></p><p><b>2<sup>nd</sup> place:</b><br><a class="link" target="blank" href="https://youtu.be/1shgWz36dZQ">\u{1F1F1}\u{1F1F9} Jievaras Jasinskis ("Change")</a></p><p><b>3<sup>rd</sup> place:</b><br><a class="link" target="blank" href="https://youtu.be/JwetrB18vhQ">\u{1F1E9}\u{1F1EA}\u{1F1F5}\u{1F1F1} Roman Czura ("Rythms Drowned in Dreams")</a><br><a class="link" target="blank" href="https://youtu.be/R723Cu2UURM">\u{1F1F1}\u{1F1F9} Andrius Maslekovas ("Waters-Reflections-Haiku")</a></p><p><b>Saulius Karosas special prize for the best composition of the Lithuanian author:</b><br><a class="link" target="blank" href="https://youtu.be/1shgWz36dZQ">\u{1F1F1}\u{1F1F9} Jievaras Jasinskis ("Change")</a></p><p><b>Audience Sympathy prize:</b><br><a class="link" target="blank" href="https://youtu.be/_osuSpFDdcA">\u{1F1ED}\u{1F1FA} Apor Sz\xFCts ("Rondo una quasi toccata")</a></p><p><b>Orchestra Sympathy prize:</b><br><a class="link" target="blank" href="https://youtu.be/_osuSpFDdcA">\u{1F1ED}\u{1F1FA} Apor Sz\xFCts ("Rondo una quasi toccata")</a></p><p><b>Also, the following pieces were performed:</b><br><a class="link" target="blank" href="https://youtu.be/xwgdHSeeGx4">\u{1F1EC}\u{1F1F7} Miran Tsalikian "Baltic Tribes (Renaissance of Lith)"</a><br><a class="link" target="blank" href="https://youtu.be/E84BalXlPAw">\u{1F1EE}\u{1F1F9} Daniele Testa "The Mirrors Room"</a></p><b>CONGRATULATIONS TO THE COMPOSERS!</b><br> You can watch the full concert on <a class="link" target="blank" href="https://youtu.be/M6F3uD_ocEE?t=2065">our YouTube channel</a>.',lt:'<p>D\u017Eiaugsmingai prane\u0161ame II-ojo tarptautinio kompozicij\u0173 simfoniniam orkestrui konkurso rezultatus!</p><p><b>1-oji vieta:</b><br><a class="link" target="blank" href="https://youtu.be/Mng62a6KlJ4">\u{1F1F2}\u{1F1FD} Charles Philip Daniels Torres ("The Myth of De\u0301remot-Be\u0301lel")</a></p><p><b>2-oji vieta:</b><br><a class="link" target="blank" href="https://youtu.be/1shgWz36dZQ">\u{1F1F1}\u{1F1F9} Jievaras Jasinskis ("Change")</a></p><p><b>3-oji vieta:</b><br><a class="link" target="blank" href="https://youtu.be/JwetrB18vhQ">\u{1F1E9}\u{1F1EA}\u{1F1F5}\u{1F1F1} Roman Czura ("Rythms Drowned in Dreams")</a><br><a class="link" target="blank" href="https://youtu.be/R723Cu2UURM">\u{1F1F1}\u{1F1F9} Andrius Maslekovas ("Waters-Reflections-Haiku")</a></p><p><b>Sauliaus Karoso fondo \u012Fsteigtas specialius prizas \u201Eu\u017E geriausi\u0105 lietuvi\u0173 autoriaus k\u016Brin\u012F\u201C:</b><br><a class="link" target="blank" href="https://youtu.be/1shgWz36dZQ">\u{1F1F1}\u{1F1F9} Jievaras Jasinskis ("Change")</a></p><p><b>Publikos simpatija:</b><br><a class="link" target="blank" href="https://youtu.be/_osuSpFDdcA">\u{1F1ED}\u{1F1FA} Apor Sz\xFCts ("Rondo una quasi toccata")</a></p><p><b>Orkestro simpatija:</b><br><a class="link" target="blank" href="https://youtu.be/_osuSpFDdcA">\u{1F1ED}\u{1F1FA} Apor Sz\xFCts ("Rondo una quasi toccata")</a></p><p><b>Taip pat \u0161ie k\u016Briniai buvo atlikti finalinio turo metu:</b><br><a class="link" target="blank" href="https://youtu.be/xwgdHSeeGx4">\u{1F1EC}\u{1F1F7} Miran Tsalikian "Baltic Tribes (Renaissance of Lith)"</a><br><a class="link" target="blank" href="https://youtu.be/E84BalXlPAw">\u{1F1EE}\u{1F1F9} Daniele Testa "The Mirrors Room"</a></p><b>SVEIKINIMAI KOMPOZITORIAMS!</b><br> Vis\u0105 koncert\u0105 galite perziureti <a class="link" target="blank" href="https://youtu.be/M6F3uD_ocEE?t=2065">m\u016Bs\u0173 YouTube kanale</a>.'}},Pi={regular:"charles_torres.jpg",small:"charles_torres_small.jpg",caption:{en:"Winner of the 2020 Future Symphony Competition, Charles Philip Daniels Torres",lt:"2020 m. Future Symphony konkurso nugal\u0117tojas, Charles Philip Daniels Torres"}};var ta={slug:Ci,meta:Mi,date:Ii,title:$i,content:Ri,images:Pi},ya=Object.freeze({__proto__:null,[Symbol.toStringTag]:"Module",slug:Ci,meta:Mi,date:Ii,title:$i,content:Ri,images:Pi,default:ta});const Ki="registration_22",Ji={en:"We would like to express our sincere gratitude to Lietuvos kult\u016Bros taryba, Asociacija LATGA, Mr. Gediminas Kuprevi\u010Dius, Vilniaus miesto savivaldyb\u0117, Lithuanian National Philharmonic (Filharmonija) and Saulius Karosas Foundation for making the Future Symphony Competition possible!",lt:"Nuo\u0161ird\u017Eiai d\u0117kojame Future Symphony '22 konkurs\u0105 finansuojan\u010Dioms Lietuvos kult\u016Bros tarybai, asociacijai LATGA, konkurso mecenatui Gediminui Kuprevi\u010Diui, konkurso r\u0117m\u0117jams Vilniaus miesto savivadlybei, Lietuvos nacionalinei filharmonijai ir Sauliaus Karoso fondui."},Oi={en:"March 1<sup>st</sup>, 2022 - 6:00 pm",lt:"2022 m. kovo 1 d. 18:00"},Ni={en:"Registration to the 3<sup>rd</sup> Future Symphony Competition",lt:"Registracija \u012F III-i\u0105j\u012F \u201EFuture Symphony\u201C konkurs\u0105"},Bi={full:{en:"<p>We would like to express our sincere gratitude to Lietuvos kult\u016Bros taryba, Asociacija LATGA, Mr. Gediminas Kuprevi\u010Dius, Vilniaus miesto savivaldyb\u0117, Lithuanian National Philharmonic (Filharmonija) and Saulius Karosas Foundation for making the Future Symphony Competition possible!</p><p>Their generosity enables us to reduce the application fee to <b>50 EUR</b>. There is no early application fee anymore.</p><p>The opening of the registration platform is postponed. It will open up by March 10th.</p><p>We kindly remind you, that the score submission deadline is the 30<sup>th</sup> of June.</p>",lt:"<p>Nuo\u0161ird\u017Eiai d\u0117kojame Future Symphony '22 konkurs\u0105 finansuojan\u010Dioms Lietuvos kult\u016Bros tarybai, asociacijai LATGA, konkurso mecenatui Gediminui Kuprevi\u010Diui, konkurso r\u0117m\u0117jams Vilniaus miesto savivadlybei, Lietuvos nacionalinei filharmonijai ir Sauliaus Karoso fondui.</p><p>D\u0117l konkurso r\u0117m\u0117j\u0173 dosnumo turime galimyb\u0119 suma\u017Einti dalyvio mokest\u012F iki <b>50 EUR</b>. Nebelieka ankstyvosios registracijos mokes\u010Dio.</p><p>Registracijos platformos atidarymas nukeliamas. Platforma prad\u0117s veikti iki kovo 10 d.</p><p>Maloniai primename, kad k\u016Brini\u0173 konkursui pateikimo terminas \u2013 bir\u017Eelio 30 d.</p>"}},Di={regular:"fsc22_fbstory.jpg",small:"fsc22_fbstory_small.jpg"};var ea={slug:Ki,meta:Ji,date:Oi,title:Ni,content:Bi,images:Di},fa=Object.freeze({__proto__:null,[Symbol.toStringTag]:"Module",slug:Ki,meta:Ji,date:Oi,title:Ni,content:Bi,images:Di,default:ea});export{oa as _,sa as a,na as b,ra as c,la as d,ua as e,pa as f,ma as g,ca as h,ha as i,ka as j,da as k,ba as l,ga as m,ya as n,fa as o};
